import React, { useEffect, useState } from 'react';

const Navbar = () => {
  const [username, setUsername] = useState(null);
  const [showDropdown, setShowDropdown] = useState(false); // State to manage dropdown visibility

  useEffect(() => {
    // Retrieve the user information from localStorage
    const storedUser = localStorage.getItem('user');
    console.log(storedUser);
    // Only attempt to parse if the value exists and is valid JSON
    if (storedUser && storedUser !== 'undefined' && storedUser !== 'null') {
      try {
        const user = JSON.parse(storedUser); // Parse the JSON string
        if (user && user.username) {
          setUsername(user.username); // Set the username if it exists
        }
      } catch (error) {
        console.error("Error parsing user data:", error); // Log parsing error
      }
    }
  }, []);

  // Logout function
  const handleLogout = () => {
    localStorage.removeItem('user'); // Remove user from localStorage
    setUsername(null); // Clear the username state
    // Redirect or perform any additional actions after logout
    // For example, you can redirect to the login page:
    window.location.href = '/login'; // Redirect to login page
  };

  return (
    <header className="header">
      <div className="container">
        <div className="row">
          <div className="col-lg-2">
            <div className="header__logo">
              <a href="/">
                <img src="/assets/img/logo.png" alt="" />
              </a>
            </div>
          </div>
          <div className="col-lg-8">
            <div className="header__nav">
              <nav className="header__menu mobile-menu">
                <ul>
                  <li><a href="/">Home</a></li>
                  <li><a href="/favourite">Favourite</a></li>
                  <li><a href="#">Contacts</a></li>
                  {username ? (
                    <li>
                      <span 
                        onMouseEnter={() => setShowDropdown(true)} 
                        onMouseLeave={() => setShowDropdown(false)}
                      >
                        Hello, {username} &#9662; {/* Arrow Down */}
                      </span>
                      {showDropdown && (
                        <div className="dropdown">
                          <ul>
                            <li><button onClick={handleLogout}>Logout</button></li>
                          </ul>
                        </div>
                      )}
                    </li>
                  ) : (
                    <li><a href="/login">Login</a></li>
                  )}
                </ul>
              </nav>
            </div>
          </div>
          <div className="col-lg-2">
            <div className="header__right">
              <a href="#" className="search-switch"><i className="fas fa-search"></i></a>
              <a href="/login"><i className="fas fa-user"></i></a>
            </div>
          </div>
        </div>
        <div id="mobile-menu-wrap"></div>
      </div>

      {/* Add some basic CSS styles for dropdown */}
      <style jsx>{`
        .dropdown {
          position: absolute;
          background-color: white;
          border: 1px solid #ccc;
          box-shadow: 0px 0px 5px rgba(0,0,0,0.2);
          z-index: 1;
        }

        .dropdown ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }

        .dropdown li {
          padding: 8px 12px;
          cursor: pointer;
        }

        .dropdown li:hover {
          background-color: #f0f0f0;
        }
      `}</style>
    </header>
  );
};

export default Navbar;
